import React, { useState } from "react";
import { Tree, Input } from "antd";
import { CarryOutOutlined } from "@ant-design/icons";
import { SmileOutlined } from "@ant-design/icons";
const { TreeNode } = Tree;
const { Search } = Input;
const { DirectoryTree } = Tree;

const Model = () => {
  const [value, setValue] = useState();
  const onChange = (value) => {
    setValue(value);
  };

  const treeData = [
    {
      title: "asda",
      key: "0-0",
      children: [
        {
          title: "leaf 0-0",
          key: "0-0-0",
          isLeaf: true
        },
        {
          title: "leaf 0-1",
          key: "0-0-1",
          isLeaf: true
        }
      ]
    },
    {
      title: "parent 1",
      key: "0-1",
      children: [
        {
          title: "leaf 1-0",
          key: "0-1-0",
          isLeaf: true
        },
        {
          title: "leaf 1-1",
          key: "0-1-1",
          isLeaf: true
        }
      ]
    }
  ];

  return (
    <div style={{ width: "400px" }}>
      <Search
        style={{ marginBottom: 8 }}
        placeholder="Search"
        onChange={onChange}
      />
      <Tree icon={<CarryOutOutlined />}>
        <TreeNode
          key={1}
          icon={<CarryOutOutlined />}
          title={
            <div>
              <Input placeholder="Enter new folder name" />
            </div>
          }
        >
          <TreeNode
            key={2}
            title={
              <div>
                <span>s</span>
                <span>Another Column</span>
                <button>Click here</button>
              </div>
            }
          />
        </TreeNode>
      </Tree>
    </div>
  );
};

export default Model;
